import React from "react";
import ChoiceButton from "./ChoiceButton";

const Choice = ({ logo, onChoice }) => {
  return (
    <>
      <div className="choice-container">
        {/* <a href="/"><img src={logo} alt='FindMyMines'/></a> */}
        <ChoiceButton
          onChoice={onChoice}
          type="primary"
          choice="new"
          label="Start New"
        />
        <ChoiceButton
          onChoice={onChoice}
          type="secondary"
          choice="join"
          label="Join Game"
        />
      </div>
    </>
  );
};

export default Choice;
